//    - Avalie se a correlao aumenta ou diminui em dias de tendncia forte ou lateralidade.
//    - Estratgias que ganham e perdem juntas nesses perodos representam risco sistmico.
//    - Busque pares que performam de forma oposta em regimes de mercado distintos.

// 5. *Interpretao e Impacto no Portflio*
//    - Aponte quais pares de estratgias mais contribuem para a diversificao.
//    - Identifique redundncias que no agregam robustez.
//    - Sugira combinaes ideais para reduzir o risco consolidado.

